import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { UserState } from "../context/UserProvider";
import axios from "axios";

const Score = ({ socket }) => {
  const { user, score, setScore, token } = UserState();
  const navigate = useNavigate();
  const [showPopup, setShowPopup] = useState(false);
  const [movesUp, setMovesUp] = useState(0);

  useEffect(() => {
    socket.on("updated-leaderboard", (leaderboard) => {
      let position = leaderboard.users;
      setScore(position);
    });
    getScore();
  }, []);

  const getScore = async () => {
    let config = {
      headers: {
        Authorization: "Bearer " + token,
        withCredentials: true,
      },
    };

    axios
      .get(`http://localhost:5000/user/room/get`, config)
      .then((res) => {
        setScore(res.data.scores.users);
      })
      .catch((err) => {
        console.log("error", err.message);
      });
  };

  const copy = async (text) => {
    await navigator.clipboard.writeText(text);
    console.log("copied", text);
  };

  const handleMovesUp = (moves) => {
    setMovesUp(moves);
    setShowPopup(true);
  };

  const defaultAvatar = `data:image/svg+xml;base64,`;

  return (
    <div className="flex flex-col items-center justify-start min-h-screen w-full bg-gradient-to-r from-yellow-400 to-orange-500 p-5">
      <p
        className="text-4xl mt-5 cursor-pointer text-white"
        onClick={() => navigate(-1)}
      >
        <i className="fa-solid fa-angle-left mr-3"></i>
        Leaderboard
      </p>
      <div className="flex flex-col items-center justify-between w-full mt-5 max-w-2xl h-full space-y-8">
        {/* Rank List */}
        <div className="flex h-2/3 w-full bg-white rounded-lg shadow-xl overflow-y-auto p-5">
          <ul className="w-full flex flex-col gap-2">
            {score.map((item) => (
              <li
                key={item._id}
                className={`${
                  item.user && item.user.email === user.email
                    ? "bg-yellow-300"
                    : "bg-orange-200"
                } w-full px-5 py-3 rounded-lg flex items-center justify-between`}
              >
                <span className="font-bold text-lg">#{item.position <= 0 ? 1 : item.position}</span>
                <span className="flex items-center gap-3">
                  <img
                    src={item.user?.avatar || defaultAvatar}
                    alt="Avatar"
                    className="w-10 h-10 rounded-full"
                  />
                  <span className="font-bold text-lg">{item.user?.name || ""}</span>
                </span>
              </li>
            ))}
          </ul>
        </div>

        {/* Referral Link */}
        <div className="flex flex-col w-full h-1/3 max-w-2xl cursor-pointer space-y-5">
          <div className="flex flex-col items-center justify-center border-3 rounded-lg shadow-xl bg-orange-600 p-5 text-white">
            {score.map((item) => {
              if (item.user && user && item.user.email === user.email)
                return (
                  <p
                    key={item._id}
                    className="text-lg font-bold"
                    onClick={() => copy(item.user.referralCode)}
                  >
                    Your code{" "}
                    <span className="font-extrabold">{item.user.referralCode}</span>
                    <i className="fa-regular fa-clipboard mx-3"></i>
                  </p>
                );
            })}
          </div>
          {/* Instructions */}
          <div className="flex flex-col items-center justify-center text-white">
            <ul className="space-y-2 text-center">
              <li className="text-lg font-semibold">Offer on the iPhone 15 for 1st position</li>
              <li className="text-lg font-semibold">Earn 1 position forward on each referral</li>
            </ul>
          </div>
        </div>
      </div>

      {/* Popup Modal */}
      {showPopup && (
        <div className="fixed inset-0 flex items-center justify-center bg-black bg-opacity-50">
          <div className="bg-white p-5 rounded-lg shadow-lg">
            <p className="text-lg font-bold">You have moved up {movesUp} positions!</p>
            <button
              className="mt-3 bg-orange-500 text-white px-4 py-2 rounded"
              onClick={() => setShowPopup(false)}
            >
              Close
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default Score;
